import React from 'react';
import AdminPanel from './AdminPanel'
import { Redirect } from 'react-router-dom';

function AdminSide(props) {
    if (props.user?.username)
        return <Redirect to="/login" />
    return (
        <div className="App">
            Admin
            <AdminPanel />
        </div>
    );
}

export default AdminSide;
